import React from "react";
import Account from "./account/account";
import Options from "./options/options";
import { View } from "react-native-web";
import Card from "./card/cards";

export default function Menu(){
    return(
        <View>    
            <Account></Account>
            <Options></Options>
            <Card></Card>
        </View>
    )
}
